function Model(props) {
    console.log(props.props.state);

    
    return(
        <div className="Model">
            <div class="card" style="width: 18rem;">
                <ul class="list-group list-group-flush">
                    {props.props.state && <li class="list-group-item">{props.props.state}</li>}
                    {props.props.date && <li class="list-group-item">{props.props.date}</li>}
                    {props.props.cases && <li class="list-group-item">{props.props.cases}</li>}
                    {props.props.deaths && <li class="list-group-item">{props.props.deaths}</li>}
                </ul>
            </div>
        </div>
    )
}
export default Model;
